import React from 'react';
/*import './styles/Navigation.css';*/

const Navigation = () => {
    return (
        <div className="navigation">
            <button>Главная</button>
            <button>Предметы</button>
            <button>Личные задачи</button>
            <button>Профиль</button>
        </div>
    );
};

export default Navigation;
